import React from "react"
import Nav2 from "./../components/Nav2.js"
import Menu from "./../components/student_menu.js"
import "./../css/student_profile.css";
import "./../css/Student_dilosi.css";
import { logout, btnTab1, btnTab2, btnTab3 } from '../Utils/Methods/index.js';
import Footer from "./../components/footer.js"
import { Link } from "react-router-dom";

export default function StudentProfile() {

    return (
        <div>
            <Nav2 />
            <Menu />
            <div class="table1">
                <h>Δηλώσεις</h>
            </div>
            <table class="sp-table1">
                <tr>
                    <th class="dcell"> Κατάσταση </th> <th class="dcell"> Ημερομηνία </th> <th class="dcell"> Ενέργεια </th>
                </tr>
            </table>

            <Footer />
        </div>
    );
}
